import sys

class Solution:
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        
        This algorithm gives us 
        Memory Limit Exceeded
        """
        n = len(s)
        if n <= 1:
            return s
        
        table = [[0 for x in range(n)] for y 
                              in range(n)]
        for i in range(n):
            table[i][i] = True
            
        # check for sub-string of length 2. 
        start = 0
        i = 0
        while i < n - 1 : 
            if (s[i] == s[i + 1]):
                table[i][i + 1] = True
                start = i
            i = i + 1
            
        def is_palindrome(r):
            i, j = r
            if table[i][j] == 0:
                if j-i < 1:
                    return True
                else:
                    table[i][j] = s[i] == s[j] and is_palindrome((i+1, j-1))
            return table[i][j]
            
        m = 0
        longest = ''
        for i in range(n):
            for j in range(i, n):
                if is_palindrome((i, j)):
                    if m <= j-i:
                        m = j-i
                        longest = s[i:j+1]
            if m >= (n-i):
                break
                
        return longest

