class Solution:
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        n = len(s)
        
        lut = dict()
        def is_palindrome(s):
            if s not in lut:
                if len(s) <= 1:
                    return True
                lut[s] = ( s[0] == s[-1] and is_palindrome(s[1:-1]) )
            return lut[s]
            
        m = 0
        longest = ''
        for i in range(n):
            for j in range(i, n):
                if is_palindrome(s[i:j+1]):
                    if m <= j-i:
                        m = j-i
                        longest = s[i:j+1]
        return longest
